import React from "react";

class Location extends React.Component {
    
    render() {
        var elementsLocation = location.map((location, index) => {
            return <div key={index}>
                <h3>{location.name}</h3>
                <br/>
                <h4>{location.address}</h4>
            </div>
        });
        return (
            <div>
                {elementsLocation}
            </div>
        );
    }
}

export default Location;
